import TextField from "@mui/material/TextField";

export const MuiTextField = () => {
   const styles = {
      textField: {
          width: '90%',
          marginLeft: 'auto',
          marginRight: 'auto',            
          paddingBottom: 0,
          marginTop: 0,
          fontWeight: 500
      },
      input: {
          color: 'white'
      }
  };
   return (
      <TextField
         id="outlined-basic"
         className={styles.textField}
         variant="outlined"
         fullWidth
         label="Search"
         InputProps={{
            className: styles.input
          }}
      />
   )
}
